    "physical-chemical-phytoplankton-marine-toxin-and-other-data-from-bottle-casts-and-bottom-grabs-",nt"isopen":
    false,nt"url": null,nt"notes": "Physical, chemical, phytoplankton, marine
    toxin, and other data from bottle casts and bottom grabs from NOAA Ship ALBATROSS
    IV and other platforms from 12 February 1977 to 10 August 1981. Data were collected
    by the Fish and Wildlife Service - Eastern Pennsylvania Region (FWS) and other institutions
    as part of the North East Monitoring Program and other projects. Data were processed
    by NODC to the NODC standard F004 Water Physics and Chemistry format, the F028 Phytoplankton,
    and the F144 Marine Toxic Substances and Pollutants format. Full format and format
    code descriptions are available at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThe
    F004 format is used for data from measurements and analyses of physical and chemical
    characteristics of the water column. Among chemical parameters that may be recorded
    are salinity, PH, and concentration of oxygen, ammonia, nitrate, phosphate, chlorophyll,
    and suspended solids. Physical parameters that may be recorded include temperature,
    density (sigma-t), transmissivity, and current velocity (east-west and north-south
    components). Cruise and station information, including environmental conditions
    of the study site at the time of observations, is also included.nnThis F028 format
    is used for data from the sampling and analysis of marine phytoplankton. Information
    on phytoplankton abundance, distribution, and productivity derived from these data
    support studies of marine populations and ecosystems. Data reported may include:
    position, date, and time of sampling; bottom depth and sampling depths; volume of
    water filtered; and concentration of cells, carbon concentration, wet and dry weight,
    and counts for each species reported. Comments may be relayed in a text record.nnThe
    F144 format contains data on ambient concentrations of toxic substances and other
    pollutants in the marine environment. The data derive from laboratory analyses of
    samples of water, sediment, or marine organisms. Samples may have been collected
    near marine discharge sites or during ocean monitoring surveys of large areas. Field
    observations of tar deposits on beaches may also be reported. Survey information
    includes platform type, start and end dates, and investigator and institution. If
    data are collected near a discharge site, discharge location, depth, distance to
    shore, average volume, and other characteristics are reported. Position, date, time
    and environmental conditions are reported for each sample station. Environmental
    data may include meteorological and sea surface conditions, tide stage and height,
    depth of the thermocline or mixed layer surface temperature and salinity, and wave
    height and periods. Sample characteristics, collection methods, and laboratory techniques
    are reported for each sample collected and analyzed. The data record comprises concentration
    values (or a code to indicate trace amounts) for each chemical substance analyzed.
    Chemical substances are identified by codes based on the registry numbers assigned
    by the Chemical Abstracts Service (CAS) of the American Chemical Society. Marine
    organisms from which samples have been taken are identified using the 12-digit NODC
    Taxonomic Code. A text record is available for optional comments.",nt"license_title":
